import { useEffect, useState } from 'react';
import UsernameComponent from './components/usernameComponent';

function App() {
  const [sessionId, setSessionId] = useState(parseInt(sessionStorage.getItem("sessionId")) || 0);
  const [userID, setUserID] = useState(parseInt(sessionStorage.getItem("userID")) || 0);

  return (
    <>
      {userID != null && sessionId != null & userID.length == 0 && <UsernameComponent sessionId={sessionId} setSessionId={setSessionId} userID={userID} setUserID={setUserID} />}

        <input type="text" className='border'>Lobby</input>
        <input type="text" className='border'>Name</input>
    </>
  );
}

export default App;
